#include "cs_mw_advanced.h"
#include "ui_cs_mw_advanced.h"

GNSS_CS_MW_Advanced::GNSS_CS_MW_Advanced(QWidget *parent) :
    QDialog(parent),
    uiCSMW(new Ui::GNSS_CS_MW_Advanced)
{
    uiCSMW->setupUi(this);

    // Set StyleSheet
    #if (defined Q_OS_WIN32)
        QFile qss(":/data/WinStyle.qss");
        qss.open(QFile::ReadOnly);
        this->setStyleSheet("QPushButton{border-radius: 2px; padding: 3px; width: 70px;}\
                            QPushButton:enabled{background-color:rgb(235,235,245); color:black;border: 1px solid rgb(124,124,124);}\
                            QPushButton:disabled{background-color:rgb(203,203,203); color:rgb(156,156,156);border: 1px solid rgb(185,185,185);}\
                            QPushButton:checked{background-color:rgb(173,216,230); color:black;border: 1px solid rgb(124,124,124);}"+qss.readAll());
        qss.close();
    #elif (defined Q_OS_MAC)
        QFile qss(":/data/MacStyle.qss");
        qss.open(QFile::ReadOnly);
        this->setStyleSheet(qss.readAll());
        qss.close();
    #else
        QFile qss(":/data/LinuxStyle.qss");
        qss.open(QFile::ReadOnly);
        this->setStyleSheet(qss.readAll());
        qss.close();
    #endif

    this->setWindowTitle("MW Cycle-Slip Detection Advanced Advanced Configuration");
    this->InitPushButtonGNSSPointers();
    this->InitPushButtonGNSSMinFuncPointers();
    this->InitCombinationPointers();
    this->setCSdefaults();
    uiCSMW->pushButtonCSMWAdvancedOk->setFocus();

    uiCSMW->pushButtonCSMWAdvancedCancel->setHidden(true); //Remove when Cancel buttons undo all changes made by the user
}

GNSS_CS_MW_Advanced::~GNSS_CS_MW_Advanced()
{
    delete uiCSMW;
}

//Function to initialize pointers to CheckBox widget pointers
void GNSS_CS_MW_Advanced::InitPushButtonGNSSPointers(){
    PushButtonGNSS[GPS]=uiCSMW->pushButtonGPS;
    PushButtonGNSS[Galileo]=uiCSMW->pushButtonGalileo;
    PushButtonGNSS[GLONASS]=uiCSMW->pushButtonGLONASS;
    PushButtonGNSS[GEO]=uiCSMW->pushButtonGEO;
    PushButtonGNSS[BDS]=uiCSMW->pushButtonBDS;
    PushButtonGNSS[QZSS]=uiCSMW->pushButtonQZSS;
    PushButtonGNSS[IRNSS]=uiCSMW->pushButtonIRNSS;
}

//Function to initialize pointers to pushButton GNSS Measurements _clicked() functions
void GNSS_CS_MW_Advanced::InitPushButtonGNSSMinFuncPointers(){
    PushButtonGNSSFunctions[GPS]=&GNSS_CS_MW_Advanced::on_pushButtonGPS_clicked;
    PushButtonGNSSFunctions[Galileo]=&GNSS_CS_MW_Advanced::on_pushButtonGalileo_clicked;
    PushButtonGNSSFunctions[GLONASS]=&GNSS_CS_MW_Advanced::on_pushButtonGLONASS_clicked;
    PushButtonGNSSFunctions[GEO]=&GNSS_CS_MW_Advanced::on_pushButtonGEO_clicked;
    PushButtonGNSSFunctions[BDS]=&GNSS_CS_MW_Advanced::on_pushButtonBDS_clicked;
    PushButtonGNSSFunctions[QZSS]=&GNSS_CS_MW_Advanced::on_pushButtonQZSS_clicked;
    PushButtonGNSSFunctions[IRNSS]=&GNSS_CS_MW_Advanced::on_pushButtonIRNSS_clicked;
}
