        uiCSMW->comboBoxMWComb1Code2F2MeasGPS->setCurrentIndex(0);
        uiCSMW->comboBoxMWComb1Code2F5MeasGPS->setCurrentIndex(0);
        uiCSMW->stackedWidgetMWComb1Phase2MeasGPS->setEnabled(false);
