            uiCSMW->comboBoxMWComb1Freq2GEO->setCurrentIndex(1);
            uiCSMW->stackedWidgetMWComb1Code2MeasGEO->setEnabled(true);
            uiCSMW->stackedWidgetMWComb1Code2MeasGEO->setCurrentIndex(0);
